(1983, 1, NULL, 6191815143, 'text', 'Здравствуйте!\nКомпания BDB Commerce предлагает расходные материалы для термопринтеров — термоэтикетки и термоленты (чеки) по выгодным оптовым ценам.\n\n⸻\n\n📦 Наш ассортимент\n\n✅ Термоэтикетки — ЭКО и ТОП, любых размеров и намоток (втулка 40/76 мм)\n✅ Термоленты (чековая лента) — 44, 57 и 80 мм, плотная бумага, ровная намотка\n✅ Изготовление этикеток под заказ — нужный размер, форма, дизайн\n✅ Печать логотипа или рекламы на обратной стороне чеков или этикеток\n\n⸻\n\n💰 Почему выбирают BDB Commerce\n • Стабильное качество и быстрая отгрузка\n • Постоянное наличие стандартных размеров на складе\n • Оптовые и партнёрские цены\n • Быстрая доставка по Узбекистану\n • Поддержка и консультации по подбору материалов\n\n⸻\n\n📞 Связаться с нами\n\n📍 BDB Commerce — ваш надёжный поставщик расходников для POS- и термопринтеров.\nОтправьте размер и количество — подготовим индивидуальное предложение.', 11824980, 47544, 1759931754, NULL, NULL, '2025-10-08 15:55:55', '2025-10-08 15:55:55', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', NULL),
