(4413, 0, NULL, 6804515935, 'text', 'Transceka Logistic Service- транспортно- экспедиторская компания. \n\nНемного о Нас:\n- опыт в логистике более 10 лет\n- собственный автопарк+ широкая партнёрская сеть перевозчиков\n-хорошая репутация на рынке( нас рекомендуют существующие партнеры)\n- своевременное ведение документации(более 400 перевозок ежемесячно)\n- профессиональная команда логистов, для которых важен Ваш бизнес\n\nЕсть грузы? Просто позвоните мне.\n\nС Уважением,\nАлиматова Зилола \nМенеджер по продажам\nМ: +998 93 007 41 45\nE: sales2@tlsgroup.uz\nW: https://tlsgroup.uz/', 11827598, 53756, 1763640633, NULL, NULL, '2025-11-20 14:10:34', '2025-11-20 14:10:34', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', NULL),
