(5809, 1, NULL, 8173867293, 'text', 'Assalomu alaykum!\nBDB Commerce kompaniyasi sizga termoprinterlar uchun sarf materiallarini — termo-etiketkalar va termocheklarni taklif etadi.\nBiz sifatli mahsulotni qulay narxlarda yetkazib beramiz!\n\n⸻\n\n📦 Mahsulotlarimiz\n\n✅ Termo-etiketkalar — ECO va TOP turlari, istalgan o‘lcham va uzunlikda (vtulka 40/76 mm)\n✅ Termocheklar (termolenta) — 44 mm, 57 mm va 80 mm, yuqori sifatli qog‘oz, silliq o‘ram\n✅ Sizning logotipingiz yoki reklamangiz bilan maxsus bosma qilish imkoniyati\n✅ Buyurtmangizga mos etiketkalar tayyorlab beramiz\n\n⸻\n\n💰 Nega BDB Commerce?\n • Barqaror sifat va tez yetkazib berish\n • Omborda doimiy mavjud standart o‘lchamlar\n • Hamkorlar uchun chegirmalar\n • Butun O‘zbekiston bo‘ylab yetkazib berish\n • Mutaxassislarimizdan bepul maslahat\n\n⸻\n\n📞 Bog‘lanish uchun\n\n📍 BDB Commerce — termoprinter va POS uskunalari uchun ishonchli sarf materiallar yetkazib beruvchisi.\nO‘lcham va miqdorni yuboring — biz sizga shaxsiy taklif tayyorlaymiz!', 11829030, 56321, 1764912364, NULL, NULL, '2025-12-05 07:26:05', '2025-12-05 07:26:05', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', NULL),
