(6682, 0, NULL, 297241139, 'text', 'У нас склад, только отгрузки со склада будут делать, но оборотов пока мало. Хотим выбрать сканер, не можем определиться какую модель взять. \nДрайвер не нужен ему?\nИ может работать с программой Мой Склад?', 11829929, 58325, 1766637462, NULL, NULL, '2025-12-25 01:37:42', '2025-12-25 01:37:42', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', 58319),
(6683, 1, NULL, 297241139, 'text', 'Для моего склада драйвер не нужен', 11829930, 58326, 1766637504, NULL, NULL, '2025-12-25 01:38:24', '2025-12-25 01:38:24', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', NULL),
(6684, 0, NULL, 297241139, 'text', 'Так бросать не будем конечно)) но то, мощный такой это хорошо.', 11829931, 58327, 1766637532, NULL, NULL, '2025-12-25 01:38:52', '2025-12-25 01:38:52', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', 58323),
(6685, 1, NULL, 297241139, 'text', 'На счет зарядки, так как у него подставка подзарижаеть', 11829932, 58328, 1766637534, NULL, NULL, '2025-12-25 01:38:54', '2025-12-25 01:38:54', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', NULL),
(6686, 0, NULL, 297241139, 'text', 'Долго да держит заряд?\nЕсли делать инвентаризацию например, хватит на весь день?', 11829933, 58329, 1766637566, NULL, NULL, '2025-12-25 01:39:26', '2025-12-25 01:39:26', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', NULL),
