(7499, 1, NULL, 1936361, 'text', '<!DOCTYPE html>\n<html>\n<head>\n<meta charset=\"UTF-8\">\n<title>GS1 DataMatrix Generator</title>\n<script src=\"https://unpkg.com/bwip-js/dist/bwip-js-min.js\"></script>\n<style>\nbody { font-family: Arial; padding: 20px; }\ninput { width: 600px; padding: 10px; font-size: 16px; }\nbutton { padding: 10px 20px; font-size: 16px; }\ncanvas { margin-top: 20px; border:1px solid #ccc; }\n</style>\n</head>\n<body>\n\n<h2>GS1 DataMatrix generator</h2>\n\n<input id=\"code\" placeholder=\"0104780069000130215bfeyXPZqPTfs93KriO\">\n<button onclick=\"generate()\">Generate</button>\n\n<br>\n<canvas id=\"dm\"></canvas>\n\n<script>\nfunction validateGS1(code) {\n    code = code.replace(/\\x1D/g, \'\');\n\n    if (!code.startsWith(\"01\")) return false;\n    if (!/^\\d{14}/.test(code.substr(2,14))) return false;\n\n    if (code.substr(16,2) !== \"21\") return false;\n\n    let idx93 = code.indexOf(\"93\",18);\n    if (idx93 === -1) return false;\n\n    let serial = code.substring(18, idx93);\n    if (serial.length < 1 || serial.length > 20) return false;\n\n    let crypto = code.substring(idx93+2);\n    if (crypto.length < 4) return false;\n\n    return true;\n}\n\nfunction generate() {\n    let input = document.getElementById(\"code\").value.trim();\n\n    if (!validateGS1(input)) {\n        alert(\"Invalid GS1 mark\");\n        return;\n    }\n\n    try {\n        bwipjs.toCanvas(document.getElementById(\"dm\"), {\n            bcid:        \'gs1datamatrix\',\n            text:        input,\n            scale:       4,\n            includetext: false\n        });\n    } catch (e) {\n        alert(e);\n    }\n}\n</script>\n\n</body>\n</html>', 11830806, 60242, 1767974922, NULL, NULL, '2026-01-09 13:08:43', '2026-01-09 13:08:43', 'jyVnDVSiwEnNEgAA7TA9fKfGd7M', NULL),
